import Navigation from "./Navigation/Navigation";
import { Redirect, Route, Switch } from "react-router-dom";
const Items = React.lazy(() => import("src/views/"));
const Home = () => {
  return (
    <>
      <Navigation />
      <Switch>
        <Route path="/home" exact>
          <Redirect to="/home/item" />
        </Route>
        <Route path="/home/item" component={Item} exact />
      </Switch>
    </>
  );
};
export default Home;
